let state = {
    profilePage:{
      posts: [
          { id: 1, message: "Hi, how are you?", likesCount: 12 },
          { id: 2, message: "Its my first post", likesCount: 11 },
        ],
        dialogs:  [
          { id: 1, name: "Anya" },
          { id: 2, name: "Vova" },
          { id: 3, name: "Misha" },
          { id: 4, name: "Dima" },
          { id: 5, name: "Grisha" },
        ]
    },
    messagesPage:{
      messages: [
          { id: 1, message: "Hi" },
          { id: 2, message: "HELLOO" },
          { id: 3, message: "MayyyyY" },
          { id: 4, message: "byyyyyyyyyyyeee" },
          { id: 5, message: "LET ME" },
        ]
    }  
}

export default state;
